ower of choice is untrammelled and when nothing prevents\";}i:4;a:1:{s:5:\"terms\";s:114:\"to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated\";}}', 'a:3:{s:7:\"heading\";s:0:\"\";i:0;a:2:{s:12:\"amend_policy\";s:23:\"Changing departure date\";s:18:\"amend_policy_right\";s:34:\" Changing pick up time or location\";}i:1;a:2:{s:12:\"amend_policy\";s:13:\"Changing tour\";s:18:\"amend_policy_right\";s:19:\"Changing guest name\";}}', '', '&lt;p&gt;&lt;span style=&quot;font-family: &quot;Verlag A&quot;, &quot;Verlag B&quot;; font-size: 17px; text-align: center; background-color: rgb(254, 246, 235);&quot;&gt;Travel to tropical island havens, hike in the breathtakingly beautiful Swiss mountains and marvel at the starry night sky. Be an explorer on a trip through the endless landscapes of Botswana, spend a night at a luxurious lodge and be woken up by the rising sun. Forget time, unwind, enjoy authentic, warm hospitality in an exclusive Greek island resort. Soak up the endless expanse of blue on the high seas. Stand at the prow of an expedition ship, inhale the crystal-clear sea air and listen to the ice break. Dream. Dive head over heels into a pulsating metropolis. Live in the moment. Whatever you are dreaming of, here you will find select offers from the SIGNATURE VOYAGES premium travel portfolio.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'a:4:{i:0;a:1:{s:11:\"hotel_notes\";s:246:\"Permit require for Tsomgo Lake. It is mandatory that guest should carry 04 copies of pass  port size photograph, original photo ID proof with photo copy (identity card  Voter ID card/Pass-port/Driving License etc) for processing the permit.\";}i:1;a:1:{s:11:\"hotel_notes\";s:158:\"Permit also require for traveling to North Sikkim (Lachung & Lachen). Requires 02 more copies of passport size photographs along with original photo ID proof.\";}i:2;a:1:{s:11:\"hotel_notes\";s:118:\"The above mentioned hotels will be confirmed as per the room availability. Otherwise we will confirm similar category.\";}i:3;a:1:{s:11:\"hotel_notes\";s:177:\"The rates quoted in the packages are on per person basis, valid for Indian nationals & till 15th Sep 2014 (High seasons surcharge will be applicable from 20TH Dec  04TH Jan).\";}}', 'a:1:{i:0;a:1:{s:11:\"rates_notes\";s:0:\"\";}}', 'a:5:{i:0;a:1:{s:9:\"hotel_exc\";s:22:\"Air Fare / Train fare.\";}i:1;a:1:{s:9:\"hotel_exc\";s:173:\"Personal expenses such as laundry, telephone calls, tips & gratuity, mineral water, soft & hard drinks, rafting, rock climbing, paragliding, joy ride (Toy Train), porterage.\";}i:2;a:1:{s:9:\"hotel_exc\";s:88:\"Additional sightseeing or extra usage of vehicle, other than mentioned in the itinerary.\";}i:3;a:1:{s:9:\"hotel_exc\";s:29:\"Entrance Fees & Guide charges\";}i:4;a:1:{s:9:\"hotel_exc\";s:181:\"Any cost arising due to natural calamities like, landslides, road blockage, political disturbances (strikes), etc (to be borne by the client, which is directly payable on the spot).\";}}', 'Hotel Terms You will find below the package that we propose for your unique vacation experience. Based on the preferences that you have highlighted to us previously, we feel that this plan would be the best arrangement. However, if there are further changes that you would like to add, we will be happy to amend it. Trackitinerary has enjoyed helping thousands of people experience amazing holidays, and we aim to do the same for you. Heres to an unforgettable trip ahead!', 'a:3:{s:7:\"heading\";s:0:\"\";i:0;a:2:{s:10:\"pay_policy\";s:31:\"1  60 days prior to arrival	\";s:16:\"pay_policy_right\";s:8:\"100% Pay\";}i:1;a:2:{s:10:\"pay_policy\";s:31:\"61  90 days prior to arrival\";s:16:\"pay_policy_right\";s:12:\"100% Payable\";}}', 'a:1:{i:0;a:1:{s:11:\"benefit_inc\";s:7:\"safsadf\";}}', 'a:3:{i:0;a:1:{s:9:\"hotel_inc\";s:28:\"Hotel Terms Hotel Inclusions\";}i:1;a:1:{s:9:\"hotel_inc\";s:31:\"Hotel Terms Hotel Inclusions 00\";}i:2;a:1:{s:9:\"hotel_inc\";s:31:\"Hotel